import React from "react";
import PropTypes from "prop-types";

import { Avatar, Div, Panel, PanelHeader } from "@vkontakte/vkui";

import "./Home.css";
import logo from "../img/Logo.png";
import warning from "../img/Union.svg";

const Home = ({ id, groups }) => (
  // <Panel id={id}>
  //   <PanelHeader>Example</PanelHeader>
  //   {groups.length > 0
  //     ? groups.map((group) => (
  //         <Avatar size={80} src={group.photo_100} key="1" />
  //       ))
  //     : ""}
  // </Panel>
  <>
    <div className="header">
      <img src={logo} className="header__logo"></img>
      <div className="header__content">Бесплатный подбор займов</div>
    </div>
    <div className="block">
      <div class="block-form">
        <div class="block-form__title">Сумма кредита</div>
        <div class="block-form__price">
          <span class="block-form__price-text">30 000 ₽</span>
        </div>
        <div class="block-form__slidecontainer">
          <input
            type="range"
            min="5000"
            max="250000"
            step="1000"
            value="50000"
            class="slider slider-progress"
            id="myRange"
            oninput="rangePrice()"
            onchange="changeInput()"
          />
        </div>
        <div class="block-form__price-range">
          <span class="price__range-item">3 000 ₸</span>
          <span class="price__range-item">250 000 ₸</span>
        </div>
        <div>
          <form action="./form.html">
            <input
              type="submit"
              value="Подобрать займ"
              onclick="buttonClick()"
              className="block-form__button"
            />
          </form>
        </div>
        <div class="block-form__desc">
          <img src={warning} alt="warning" class="intro__desc-logo" />
          <div class="block__desc-text">
            Финбокс позволяет получить займ и оценить качество работы МФО и МКК
          </div>
        </div>
      </div>
    </div>
  </>
);

Home.propTypes = {
  id: PropTypes.string.isRequired,
};

export default Home;
